AVAILABLE FOR JUNE JULY OR SEPTEMBER FOR 1950 - Heat and hot water are included in the rent. Quick walk to St. Elizabeths Medical Center. Great two bed for immediate access to B line green line train out the front door. Walk to the C or D line in 20minutes. Step outside to the B line. Great location for the commuter. Parking is available out back for $150 per month. Free parking on Commonwealth Ave out front. Awesome balcony/porch outside off one of the bedrooms.
Awesome location right on the train and within walking distance to a major supermarket right around the block. Walk in one direction and you`ll get to Brighton Center, full of shopping, restaurants, and bars. Walk the other direction and reach Washington Square in Brookline, heart of everything desirable in Greater Boston.
